import hand from '../../../assets/rock.png';

import './Hands.css';

const Hands = ({ hands, playerHand, computerHand }) => {
  return (
    <div ref={hands} className="hands">
      <img ref={playerHand} alt="player-hand" className="player-hand" src={hand} />
      <img ref={computerHand} alt="computer-hand" className="computer-hand" src={hand} />
    </div>
  );
};

export default Hands;
